pub enum ExchangeBoothError {
    ProgramError(ProgramError),
    ExchangeBoothErrorCode {
            exchange_booth_error_code: ExchangeBoothErrorCode,
            line: u32,
            source_file_id: SourceFileId,
        },
}

pub enum ExchangeBoothInstruction {
    InitializeExchangeBooth {
            buffer_seed: u64,
            fee_rate: [u8; ],
        },
    Deposit {
            token_name: Vec<u8>,
            amount: u64,
        },
    Withdraw {
            token_name: Vec<u8>,
            amount: u64,
        },
    Exchange {
            token_name_from: Vec<u8>,
            amount: u64,
        },
    CloseExchangeBooth {
        },
}
